  @override
  Widget build(BuildContext context) {
    final actions = <PdfPreviewAction>[
      if (!kIsWeb)
        PdfPreviewAction(
          icon: const Icon(Icons.save),
          onPressed: _saveAsFile,
        )
    ];
    return Scaffold(
      body: PdfPreview(
        allowPrinting: true,
        canChangePageFormat: false,
        maxPageWidth: 700,
        build: generateReport,
        actions: actions,
        onPrinted: _showPrintedToast,
        onShared: _showSharedToast,
      ),
    );
  }

  void _showPrintedToast(BuildContext context) {
    final ScaffoldState scaffold = Scaffold.of(context);

    scaffold.showSnackBar(
      const SnackBar(
        content: Text('Document printed successfully'),
      ),
    );
  }

  void _showSharedToast(BuildContext context) {
    final ScaffoldState scaffold = Scaffold.of(context);

    scaffold.showSnackBar(
      const SnackBar(
        content: Text('Document shared successfully'),
      ),
    );
  }

  Future<void> _saveAsFile(
    BuildContext context,
    LayoutCallback build,
    PdfPageFormat pageFormat,
  ) async {
    final Uint8List bytes = await generateReport(pageFormat);

    final Directory appDocDir = await getApplicationDocumentsDirectory();
    final String appDocPath = appDocDir.path;
    final File file = File(appDocPath + '/' + 'document.pdf');
    print('Save as file ${file.path} ...');
    await file.writeAsBytes(bytes);
    OpenFile.open(file.path);
  }

  Future<Uint8List> generateReport(PdfPageFormat pageFormat) async {
    final baseColor = PdfColors.cyan;
    var list = wave.split(',');

    final document = pw.Document(
      title: "ECG",
    );
    var pageSize = (list.length / 1500).floor();
    for (var i = 0; i < pageSize; i++) {
      var sublist = list.sublist(i * 1500, (i + 1) * 1500);
      var chart2 = pw.Chart(
        grid: pw.CartesianGrid(
          xAxis: pw.FixedAxis([0, 500, 1000, 1500]),
          yAxis: pw.FixedAxis(
            [-7000, 0, 7000],
            divisions: true,
          ),
        ),
        datasets: [
          pw.LineDataSet(
            isCurved: true,
            drawPoints: false,
            color: baseColor,
            data: getLineChartValue(sublist),
          ),
        ],
      );
      document.addPage(pw.Page(
          orientation: pw.PageOrientation.landscape,
          build: (context) {
            return pw.Expanded(child: chart2);
          }));
    }

    return document.save();
  }

  List<pw.LineChartValue> getLineChartValue(List<String> list) {
    return List<pw.LineChartValue>.generate(
      list.length,
      (i) {
        final num v = int.parse(list[i]);
        return pw.LineChartValue(i.toDouble(), v.toDouble());
      },
    );
  }
